[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "chembl"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT DISTINCT ?molecule ?moleculeName ?target ?targetName ?activityType ?value ?units
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  ?activity a cco:Activity ;
            cco:standardType ?activityType ;
            cco:standardValue ?value ;
            cco:standardUnits "nM" ;
            cco:hasMolecule ?molecule ;
            cco:hasAssay/cco:hasTarget ?target .

  ?molecule a cco:SmallMolecule ;
            rdfs:label ?moleculeName .

  ?target a cco:SingleProtein ;
          rdfs:label ?targetName ;
          cco:organismName "Homo sapiens" .

  # Filter for sub-nanomolar potency (< 1 nM)
  FILTER(xsd:decimal(?value) < 1.0)

  # Filter for relevant activity types (binding and functional assays)
  FILTER(?activityType IN ("IC50", "EC50", "Ki", "Kd", "AC50", "GI50"))
}
ORDER BY ?value
LIMIT 100"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT DISTINCT ?moleculeName ?targetName ?activityType ?value
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
