SELECT DISTINCT ?moleculeName ?chemblId ?phase ?targetName ?activityType ?value
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  ?molecule a cco:SmallMolecule ;
            rdfs:label ?moleculeName ;
            cco:chemblId ?chemblId .

  OPTIONAL { ?molecule cco:highestDevelopmentPhase ?phase }

  ?activity a cco:Activity ;
            cco:standardType ?activityType ;
            cco:standardValue ?value ;
            cco:standardUnits "nM" ;
            cco:hasMolecule ?molecule ;
            cco:hasAssay/cco:hasTarget ?target .

  ?target a cco:SingleProtein ;
          rdfs:label ?targetName ;
          cco:organismName "Homo sapiens" .

  FILTER(xsd:decimal(?value) >= 0.001 && xsd:decimal(?value) < 1.0)
  FILTER(?activityType = "Ki")
  FILTER(?phase >= 1)
}
ORDER BY ?value ?phase
LIMIT 40"}}]

[{"name": "mcp__ols__searchClasses", "input": {"query": "autophagy", "ontologyId": "go"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT (COUNT(DISTINCT ?protein) AS ?count)
WHERE {
  ?protein a up:Protein ;
           up:annotation ?annotation .
  ?annotation a up:Function_Annotation ;
              up:classifiedWith <http://purl.obolibrary.org/obo/GO_0006914> .
}"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "uniprot"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "PREFIX up: <http://purl.uniprot.org/core/>

SELECT (COUNT(DISTINCT ?protein) AS ?count)
WHERE {
  ?protein a up:Protein ;
           up:reviewed 1 ;
           up:classifiedWith <http://purl.obolibrary.org/obo/GO_0006914> .
}"}}, {"name": "mcp__ols__getDescendants", "input": {"ontologyId": "go", "classIri": "http://purl.obolibrary.org/obo/GO_0006914", "pageSize": 100}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "rhea"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "go"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "rhea", "sparql_query": "PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX rhea: <http://rdf.rhea-db.org/>

SELECT (COUNT(DISTINCT ?reaction) as ?totalReactions)
WHERE {
  ?reaction rdfs:subClassOf rhea:Reaction ;
            rhea:status rhea:Approved .
}
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "rhea", "sparql_query": "PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX rhea: <http://rdf.rhea-db.org/>

SELECT (COUNT(DISTINCT ?reaction) as ?reactionsWithGO)
WHERE {
  ?reaction rdfs:subClassOf rhea:Reaction ;
            rhea:status rhea:Approved ;
            rdfs:seeAlso ?goTerm .
  FILTER(STRSTARTS(STR(?goTerm), "http://purl.obolibrary.org/obo/GO_"))
}
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"endpoint_name": "sib", "sparql_query": "PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX rhea: <http://rdf.rhea-db.org/>
PREFIX oboinowl: <http://www.geneontology.org/formats/oboInOwl#>

SELECT (COUNT(DISTINCT ?reaction) as ?reactionsWithMF)
WHERE {
  GRAPH <http://rdfportal.org/dataset/rhea> {
    ?reaction rdfs:subClassOf rhea:Reaction ;
              rhea:status rhea:Approved ;
              rdfs:seeAlso ?goTerm .
    FILTER(STRSTARTS(STR(?goTerm), "http://purl.obolibrary.org/obo/GO_"))
  }
  GRAPH <http://rdfportal.org/ontology/go> {
    ?goTerm oboinowl:hasOBONamespace "molecular_function"^^xsd:string .
  }
}
"}}]

[{"name": "mcp__togomcp__get_sparql_endpoints", "input": {}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "uniprot"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?protein ?mnemonic ?fullName ?goLabel
WHERE {
  # Get reviewed human proteins with kinase in their name
  ?protein a up:Protein ;
           up:reviewed 1 ;
           up:organism <http://purl.uniprot.org/taxonomy/9606> ;
           up:mnemonic ?mnemonic ;
           up:recommendedName ?name .
  ?name up:fullName ?fullName .
  ?fullName bif:contains "'kinase'" .

  # Get GO terms for nuclear localization
  ?protein up:classifiedWith ?goTerm .
  ?goTerm rdfs:label ?goLabel .

  # Filter for GO cellular component terms related to nucleus
  FILTER(
    STRSTARTS(STR(?goTerm), "http://purl.obolibrary.org/obo/GO_") &&
    (CONTAINS(LCASE(?goLabel), "nucleus") || CONTAINS(LCASE(?goLabel), "nuclear"))
  )
}
LIMIT 50"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?protein ?mnemonic ?fullName
WHERE {
  # Get reviewed human proteins with kinase in their name
  ?protein a up:Protein ;
           up:reviewed 1 ;
           up:organism <http://purl.uniprot.org/taxonomy/9606> ;
           up:mnemonic ?mnemonic ;
           up:recommendedName ?name .
  ?name up:fullName ?fullName .
  ?fullName bif:contains "'kinase'" .

  # Get GO terms for nuclear localization
  ?protein up:classifiedWith ?goTerm .
  ?goTerm rdfs:label ?goLabel .

  # Filter for GO cellular component terms related to nucleus
  FILTER(
    STRSTARTS(STR(?goTerm), "http://purl.obolibrary.org/obo/GO_") &&
    (CONTAINS(LCASE(?goLabel), "nucleus") || CONTAINS(LCASE(?goLabel), "nuclear"))
  )
}
ORDER BY ?mnemonic
LIMIT 100"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?protein ?mnemonic ?fullName (GROUP_CONCAT(DISTINCT ?goLabel; separator=" | ") as ?nuclearLocations)
WHERE {
  # Get reviewed human proteins with kinase in their name
  ?protein a up:Protein ;
           up:reviewed 1 ;
           up:organism <http://purl.uniprot.org/taxonomy/9606> ;
           up:mnemonic ?mnemonic ;
           up:recommendedName ?name .
  ?name up:fullName ?fullName .
  ?fullName bif:contains "'kinase'" .

  # Get GO terms for nuclear localization
  ?protein up:classifiedWith ?goTerm .
  ?goTerm rdfs:label ?goLabel .

  # Filter for GO cellular component terms related to nucleus - specifically looking for direct nuclear localization
  FILTER(
    STRSTARTS(STR(?goTerm), "http://purl.obolibrary.org/obo/GO_") &&
    CONTAINS(LCASE(?goLabel), "nucle") &&
    !CONTAINS(LCASE(?goLabel), "endonuclease") &&
    !CONTAINS(LCASE(?goLabel), "ribonucleoprotein")
  )
}
GROUP BY ?protein ?mnemonic ?fullName
ORDER BY ?mnemonic
LIMIT 150"}}]
